import React from "react";

const PercentageCell = ({ percent }) => {
   const style ={
      display: block,
      width: '100%',
      height: '100%',
      backgroundSize: `${percent}%`
   }
   return <span className="static-cell">{percent}%</span>;
};

export default PercentageCell;
